  \"2016-05-25T00:52:25.617540\",\n\t\"name\": \"atop-program\",\n\t\"isopen\": true,\n\t\"url\":
  null,\n\t\"notes\": \"The Advanced Technologies and Oceanic Procedures (ATOP) program
  replaced oceanic air traffic control systems and procedures and modernized the Air
  Route Traffic Control Center (ARTCC) facilities at Oakland, New York, and Anchorage.
  \ The ATOP program fully integrated flight and radar data processing, detects conflicts
  between aircraft, provides data link and surveillance capabilities, and automated
  the manual processes used previously.  The ATOP achieved full operating capability
  (FOC) at the New York, Oakland, and Anchorage ARTCCs in March 2005, October 2005,
  and April 2007, respectively.The ATOP system is moving forward with the preparation
  of AMS documentation for ATOP Work Package 1 follow-on enchancements for 2017 through
  2021.  ATOP Work Package 1 will include approximately nine increments.  In addition
  to Work Package 1 the program office is also initiating a Technical Refresh of the
  ATOP system during the same timeframe.\",\n\t\"license_title\": \"Other License
